insert  into `his_config_info`(`id`,`nid`,`data_id`,`group_id`,`app_name`,`content`,`md5`,`gmt_create`,`gmt_modified`,`src_user`,`src_ip`,`op_type`,`tenant_id`) values (1,13,'ace-auth.yml','DEFAULT_GROUP','','management:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n  security:\r\n    enabled: false\r\n','f305070405f44935a09b44ad42791045','2010-05-05 00:00:00','2020-07-27 15:03:21',NULL,'127.0.0.1','U',''),(0,14,'ace-auth-dev.yml','DEFAULT_GROUP','','spring:\r\n  application:\r\n    name: ace-auth\r\n  jackson:\r\n    date-format: yyyy-MM-dd HH:mm:ss\r\n    time-zone: GMT+8\r\n    default-property-inclusion: non_null\r\n  redis:\r\n    database: 2\r\n    host: ${REDIS_HOST:192.168.6.204}\r\n    port: ${REDIS_PORT:6379}\r\n    pool:\r\n    max-active: 20\r\n  datasource:\r\n    name: test\r\n    url: jdbc:mysql://${MYSQL_HOST:localhost}:${MYSQL_PORT:3306}/ag_auth_v1?useUnicode=true&characterEncoding=UTF8&\r\n    username: root\r\n    password: root\r\n    # 使用druid数据源\r\n    type: com.alibaba.druid.pool.DruidDataSource\r\n    driver-class-name: com.mysql.cj.jdbc.Driver\r\n    filters: stat\r\n    maxActive: 20\r\n    initialSize: 1\r\n    maxWait: 60000\r\n    minIdle: 1\r\n    timeBetweenEvictionRunsMillis: 60000\r\n    minEvictableIdleTimeMillis: 300000\r\n    validationQuery: select \'x\'\r\n    testWhileIdle: true\r\n    testOnBorrow: false\r\n    testOnReturn: false\r\n    poolPreparedStatements: true\r\n    maxOpenPreparedStatements: 20\r\n  rabbitmq:\r\n    host: ${RABBIT_MQ_HOST:localhost}\r\n    port:  ${RABBIT_MQ_PORT:5672}\r\n    username: guest\r\n    password: guest\r\n  sleuth:\r\n    enabled: true\r\n    http:\r\n      legacy:\r\n        enabled: true\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        server-addr: 127.0.0.1:8848\r\n    sentinel:\r\n      transport:\r\n        dashboard: localhost:8080\r\nmybatis:\r\n  basepackage: com.github.wxiaoqi.security.auth.mapper\r\n  xmlLocation: classpath:mapper/**/*.xml\r\n  mapper-locations: \"classpath*:mapper/*.xml\"\r\n\r\nserver:\r\n  port: 9777 #启动端口\r\n\r\nfeign:\r\n  httpclient:\r\n    enabled: false\r\n  okhttp:\r\n    enabled: true\r\n\r\nribbon:\r\n  eureka:\r\n    enabled: true\r\n  ReadTimeout: 60000\r\n  ConnectTimeout: 60000\r\n  MaxAutoRetries: 0\r\n  MaxAutoRetriesNextServer: 1\r\n  OkToRetryOnAllOperations: false\r\n\r\nhystrix:\r\n  threadpool:\r\n    default:\r\n      coreSize: 1000 ##并发执行的最大线程数，默认10\r\n      maxQueueSize: 1000 ##BlockingQueue的最大队列数\r\n      queueSizeRejectionThreshold: 500 ##即使maxQueueSize没有达到，达到queueSizeRejectionThreshold该值后，请求也会被拒绝\r\n  command:\r\n    default:\r\n      execution:\r\n        isolation:\r\n          thread:\r\n            timeoutInMilliseconds: 10000\r\n\r\njwt:\r\n  token-header: Authorization\r\n  expire: 14400\r\n  rsa-secret: xx1WET12^%3^(WE45\r\n\r\nclient:\r\n  id: ace-auth\r\n  secret: 123456\r\n  token-header: x-client-token\r\n  expire: 14400\r\n  rsa-secret: x2318^^(*WRYQWR(QW&T\r\n\r\nlogging:\r\n  level:\r\n#        tk.mybatis: DEBUG\r\n    com.github.wxiaoqi.security.auth: DEBUG\r\n\r\nmanagement:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n  security:\r\n    enabled: false\r\n','d296b25f7a69a444f55e370800801ee7','2010-05-05 00:00:00','2020-07-27 15:22:07',NULL,'127.0.0.1','I',''),(13,15,'ace-auth-dev.yml','DEFAULT_GROUP','','spring:\r\n  application:\r\n    name: ace-auth\r\n  jackson:\r\n    date-format: yyyy-MM-dd HH:mm:ss\r\n    time-zone: GMT+8\r\n    default-property-inclusion: non_null\r\n  redis:\r\n    database: 2\r\n    host: ${REDIS_HOST:192.168.6.204}\r\n    port: ${REDIS_PORT:6379}\r\n    pool:\r\n    max-active: 20\r\n  datasource:\r\n    name: test\r\n    url: jdbc:mysql://${MYSQL_HOST:localhost}:${MYSQL_PORT:3306}/ag_auth_v1?useUnicode=true&characterEncoding=UTF8&\r\n    username: root\r\n    password: root\r\n    # 使用druid数据源\r\n    type: com.alibaba.druid.pool.DruidDataSource\r\n    driver-class-name: com.mysql.cj.jdb