ents: 20\r\n\r\n    cloud:\r\n      nacos:\r\n        discovery:\r\n          server-addr: 127.0.0.1:8848\r\n      sentinel:\r\n        transport:\r\n          dashboard: 127.0.0.1:8080\r\nsample:\r\n  zipkin:\r\n    # When enabled=false, traces log to the console. Comment to send to zipkin\r\n    enabled: false\r\n\r\nmybatis:\r\n    basepackage: com.github.wxiaoqi.security.admin.mapper\r\n    xmlLocation: classpath:mapper/**/*.xml\r\n    mapper-locations: \"classpath*:mapper/*.xml\"\r\n\r\n# 必须配置\r\nfeign:\r\n  httpclient:\r\n    enabled: false\r\n  okhttp:\r\n    enabled: true\r\n\r\n\r\n\r\nhystrix:\r\n  threadpool:\r\n    default:\r\n      coreSize: 1000 ##并发执行的最大线程数，默认10\r\n      maxQueueSize: 1000 ##BlockingQueue的最大队列数\r\n      queueSizeRejectionThreshold: 500 ##即使maxQueueSize没有达到，达到queueSizeRejectionThreshold该值后，请求也会被拒绝\r\n  command:\r\n    default:\r\n      execution:\r\n        isolation:\r\n          thread:\r\n            timeoutInMilliseconds: 110000\r\n\r\n\r\n# 配置swagger\r\nswagger:\r\n    enabled: true\r\n    base-package: com.github.wxiaoqi.security.admin\r\n    title: ace-admin\r\n    version: 1.0.0.SNAPSHOT\r\n    description: 管理后端服务\r\n    contact:\r\n        name: admin\r\n\r\nauth:\r\n  serviceId: ace-auth\r\n  user:\r\n    token-header: Authorization\r\n  client:\r\n    id: ace-admin\r\n    secret: 123456\r\n    token-header: x-client-token\r\n\r\n#redis-cache 相关\r\nredis:\r\n    pool:\r\n         maxActive: 300\r\n         maxIdle: 100\r\n         maxWait: 1000\r\n    host: 192.168.6.204\r\n    port: 6379\r\n    password:\r\n    timeout: 2000\r\n    # 服务或应用名\r\n    sysName: ace-admin\r\n    enable: true\r\n    database: 0\r\n\r\nmanagement:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n  security:\r\n    enabled: false\r\n\r\n','4bee31b66349567625085e84b06b344b','2010-05-05 00:00:00','2020-08-06 16:54:07',NULL,'127.0.0.1','U',''),(27,47,'ace-gateway-dev.yaml','DEFAULT_GROUP','','#请求和响应GZIP压缩支持\r\nfeign:\r\n  http