    queueSizeRejectionThreshold: 500 ##即使maxQueueSize没有达到，达到queueSizeRejectionThreshold该值后，请求也会被拒绝\r\n  command:\r\n    default:\r\n      execution:\r\n        isolation:\r\n          thread:\r\n            timeoutInMilliseconds: 10000','102b0ba59ca95cb8723429bb2c2250cf','2010-05-05 00:00:00','2020-08-06 16:54:19',NULL,'127.0.0.1','U','');

